                <p>This web site may contain links to other websites. Everyday Eyecare has no control over and is not responsible for the content of any such web sites. Everyday Eyecare shall not be held liable for any claims, damages or loss of any kind either caused or purportedly caused by the content of this web site, web sites accessed through links from this web site, or any other web sites however accessed. The above is understood and agreed to by you, and accepted by you as a condition of making use of this service.</p>
            </div>
        )
    }
}

